_cache_meta.query:
{
  assets(limit: 150) {
    slug
    id
    metrics(
      where: { metricKeys: ["marketcap", "price", "active_validators", "real_reward_rate", "reward_rate", "staked_tokens", "staking_ratio", "total_staking_wallets", "total_validators"] },
      limit: 9
    ) {
      metricKey
      label
      defaultValue
    }
  }
}
